import React, { useState, useEffect } from 'react'
import ReactPaginate from 'react-paginate';
import Header from './Header'
import axios from "axios";

const List = () => {
  const [users, setUsers] = useState([]);
  const [currentPage, setCurrentPage] = useState(0);
  const [seachData, setSeachData] = useState([]);

  const handleChange = (value) => {
    const fname = seachData.filter(item => item.fname.toLowerCase().includes(value))
    const hobbies = seachData.filter(item => item.hobbies.toLowerCase().includes(value))
    setUsers([...fname,...hobbies])
  }



